import React, { Component } from "react";
import { Link, Redirect } from "react-router-dom";
import "./style.css";

class Button extends Component {
  render() {
    if (this.props.txt == "Back") {
      var towch = (
        <Link to="" className="row">
          <button className="button" onClick={this.towchdarah}>
            <span>Back</span>
          </button>
        </Link>
      );
    } else {
      var towch = (
        <Link to="/api/showdata" className="row">
          <button className="button" onClick={this.towchdarah}>
            <span>Submit</span>
          </button>
        </Link>
      );
    }
    return (
      <div>
        <Link to="/api/showdata" className="row">
          <button className="button" onClick={this.towchdarah}>
            <span>{this.props.txt}</span>
          </button>
        </Link>
      </div>
    );
  }
  towchdarah = () => {
    switch (this.props.whichcomp) {
      case "inquiry":
        console.log("this is inquiry");
        break;
      case "invoice":
        console.log("this is invoice");
        break;
      case "tokens":
        console.log("this is tokens");
        break;
      default:
        console.log("this is home");
        Redirect("http//localhost:3006/");
        break;
    }
  };
}
Button.defaultProps = {
  txt: "Submit",
};

export default Button;
